import React from 'react'

const Square = ({id, squares, handleClick}) => {
  console.log(squares)
  return (
  <>

  <div id="grid" >
  {squares.map((value,index)=> {
    return(

      <div className="square"
      id={id} 
      key={index}
      onClick={() => {handleClick(index)}}>
      {value}
      </div>
    )
   })}
</div>
</>
)
}


export default Square
